import { Icon } from '@mui/material';
import naver_button from './naver_button.svg';

const NaverIcon = () => {
  return <Icon classes={{root: classes.iconRoot}}
  ><image className={classes.imageIcon} src={naver_button} /></Icon>;
};

export default NaverIcon;
